import React from 'react'
import { Box, Text } from 'quantum-elements'
import Navbar from '../components/navbar'

export default function Home() {
  return (
    <Box>
      <Navbar />
      <Text size={72}>Hey, I'm Michael.</Text>
    </Box>
  )
}
